import React, { Component } from 'react';

import Navbar from './components/Navbar/Navbar';
import Users from './components/Users/Users';
import Posts from './components/Posts/Posts';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <Users />
        <Posts />
      </div>
    );
  }
}

export default App;
